import React from "react";
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import routes from './Config/Routes';
import vEspeciales from './Pages/AdminRestaurante/Especialidades';
import L from './Pages/Login';

function App() {
  return (
    <Router>

      <Switch>

        <Route path="/Especialidades" exact={true} component={vEspeciales} />
        <Route path="/" exact={true} component={L} />


      </Switch>

    </Router>

  );
}



function RouteWithSubRoutes(route) {

  return (

    <Route
      path={route.path}
      exact={route.exact}
      render={props => <route.component routes={route.routes} {...props} />}
    />
  );
}

export default App;
